  display: grid;
  grid-template-columns: 1.2fr 1fr;
  align-items: center;
  justify-content: space-between;
  column-gap: 50px;
  padding-bottom: 75px;
}
.idea__illustration img {
  width: 400px;
  height: auto;
  object-fit: contain;
}
.section-title {
  color: #000;
  font-weight: 700;
  font-size: 5rem;
  position: relative;
}
.idea__text .section-title {
  padding-bottom: 30px;
  margin-bottom: 20px;
}
.idea__text .section-title img {
  position: absolute;
  height: 40px;
  width: 92%;
  right: 0;
  bottom: 0;
  z-index: -1;
}
.about__content .section-title {
  padding-bottom: 10px;
}
.work__content .section-title {
  margin-bottom: 95px;
  padding-bottom: 10px;
}
.about__content .section-title img,
.work__content .section-title img {
  position: absolute;
  height: 15px;
  width: 340px;
  right: 0;
  left: 0;
  margin: 0 auto;
  bottom: 0;
  z-index: -1;
}
.ourClient__area .section-title span {
  position: relative;
}
.ourClient__area .section-title img {
  position: absolute;
  height: 45px;
  width: 180px;
  right: -50px;
  bottom: 0;
  z-index: -1;
}
.section-pragrap {
  padding-bottom: 60px;
}
.mission {
  background: var(--primary-color);
  padding: 260px 0 335px 0;
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0 75%);
}
.extra-title {
  color: #fff;
  font-size: 5rem;
  text-align: center;
  font-family: var(--codec-pro-font);
  letter-spacing: 0.1em;
  line-height: 1;
}
/* Idea area */
/* About */
.about .section-title {
  text-align: center;
}
.about__single-three,
.about__single {
  display: grid;
  grid-template-columns: 1.1fr 1fr;
  column-gap: 50px;
  padding: 65px 0;
}
.about__single-two {
  display: flex;
  flex-direction: row-reverse;
}
.about__single-two .about__single-illustration img {
  width: 100%;
  height: auto;
  object-fit: contain;
}
.about__item-technology {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  padding-left: 50px;
  padding-top: 50px;
  column-gap: 20px;
  row-gap: 20px;
}
.about__single-two .about__item-technology {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  column-gap: 20px;
  row-gap: 20px;
}
h3.about__item-title {
  color: #212529;
  font-weight: 700;
  font-size: 3.2rem;
  padding-bottom: 20px;
}
p.about__item-pragrap {
  color: #212529;
  padding-bottom: 30px;
}
.about__item-technology img {
  height: 120px;
  width: auto;
  object-fit: contain;
}
.about__single-two .about__item-technology img {
  height: 85px;
}
.about__item-technology-extra {
  display: flex;
  align-items: center;
  column-gap: 30px;
  justify-content: center;
  padding-bottom: 70px;
}
.about__item-technology-extra img {
  height: 90px;
  width: auto;
  object-fit: contain;
}
.about__single-three {
  padding-bottom: 20px;
}
