    0px 0px 3.204px #acc8e2;
  border-radius: 30px;
  overflow: hidden;
  position: relative;
}
.work__card::after {
  position: absolute;
  /* content: url("../img/"); */
}
.work__card:nth-child(1) {
  order: 1;
}
.work__card:nth-child(2) {
  order: 2;
}
.work__card:nth-child(3) {
  order: 3;
}
.work__card:nth-child(4) {
  order: 6;
}
.work__card:nth-child(5) {
  order: 5;
}
.work__card:nth-child(6) {
  order: 4;
}
.work__card-count {
  text-align: center;
  height: 20px;
  width: 20px;
  border-radius: 50%;
  background: #cf5d94;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto;
  color: #fff;
  font-size: 1.4rem;
  font-weight: 600;
  margin-top: 15px;
}
.work__card-title {
  padding: 5px 20px 20px 20px;
  text-align: center;
}
.work__card img {
  height: 160px;
  width: 100%;
  object-fit: cover;
}
