.specialist {
  background: var(--primary-color);
  margin: 75px 0;
}
.specialist__content {
  display: grid;
  grid-template-columns: 0.8fr 1fr;
  column-gap: 50px;
  align-items: center;
  justify-content: space-between;
}
.specialist__illutration img {
  width: 70%;
  height: auto;
  object-fit: contain;
}
.specialist__title {
  color: #fff;
  font-size: 5.5rem;
  font-weight: 700;
  padding-bottom: 20px;
}
.specialist__pragrap {
  color: #fff;
  padding-bottom: 50px;
}
