.ourClient {
  padding-top: 60px;
}
.ourClient .section-title {
  text-align: center;
  margin-bottom: 70px;
}
.ourClient__slide {
  display: grid;
  align-items: center;
}
.ourClient__slide.owl-carousel .owl-stage {
  display: flex;
}
.ourClient__single {
  display: flex;
  flex: 1 0 auto;
  height: 100%;
  flex-direction: column;
}
.ourClient__single {
  background: #ffffff;
  box-shadow: 15px 10px 50px rgba(0, 0, 0, 0.1);
  border-radius: 10px;
  padding: 50px 40px;
  transition: 0.3s all ease-in-out;
}
.ourClient__slide .owl-item.center .ourClient__single {
  background: #101728;
}
.ourClient__slide hr {
  background: #101728;
  height: 2px;
  margin: 30px 0;
}
.ourClient__slide .owl-item.center .ourClient__single hr {
  background: #ffffff;
}
.quat {
  margin-bottom: 10px;
  display: block;
}
.quat i {
  font-size: 7rem;
  color: #043873;
}
.ourClient__slide .owl-item.center .ourClient__single .quat i {
  color: #fff;
}
.slide__pragrap {
  color: #101728;
}
.ourClient__slide .owl-item.center .ourClient__single .slide__pragrap {
  color: #fff;
}
.ourClient__prifile {
  display: grid;
  grid-template-columns: 1fr 3fr;
  column-gap: 20px;
  align-items: center;
}
.profile__tile {
  padding-bottom: 10px;
  font-size: 2.2rem;
  color: #101728;
}
.ourClient__slide .owl-item.center .ourClient__single .profile__tile {
  color: #fff;
}
.profile__pragrap {
  color: #101728;
  font-size: 1.5rem;
}
.ourClient__slide .owl-item.center .ourClient__single .profile__pragrap {
  color: #fff;
}
.try__digital {
  background: var(--primary-color);
  padding: 75px 0;
  text-align: center;
  margin-top: 75px;
}
.extra__pragrap {
  color: #fff;
  padding: 45px 0;
}
/* ourClient */
/* Footer */
footer {
  background: var(--primary-color);
  padding-bottom: 75px;
}
.footer__widgets-menu {
  display: grid;
  grid-template-columns: 2fr 1fr 1fr 1.5fr;
  align-items: flex-start;
}
.widget__tile {
  color: #fff;
  font-size: 1.8rem;
  font-weight: 600;
  padding-bottom: 20px;
}
.footer__widget-single ul {
  display: flex;
  flex-direction: column;
  row-gap: 10px;
}
.footer__widget-single ul li {
  list-style-type: none;
}
.footer__widget-single ul li a {
  color: #fff;
  text-decoration: none;
  font-weight: 400;
  transition: 0.3s all ease;
}
.footer__widget-single ul li a:hover {
  text-decoration: underline;
}
/* Footer Socail */
.footerSocial {
  display: flex;
  align-items: center;
  justify-content: flex-end;
  column-gap: 30px;
}
.footerSocial li {
  list-style-type: none;
}
.footerSocial li i {
  font-size: 3.5rem;
  color: #fff;
}
/* Footer */
#back-to-top {
  position: fixed;
  display: none;
  right: 40px;
  bottom: 60px;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: center;
  height: 50px;
  border: none;
  color: #fff;
  width: 50px;
  border-radius: 50%;
  background: linear-gradient(
    180deg,
    #831ba9 0%,
    rgba(225, 75, 109, 0.77) 99.99%,
    rgba(230, 78, 106, 0) 100%
  );
  filter: drop-shadow(0px 0px 42.913px #ffffff1e)
    drop-shadow(0px 0px 24.5217px #ffffff1e)
    drop-shadow(0px 0px 14.3043px #ffffff1e)
    drop-shadow(0px 0px 7.15217px #ffffff1e)
    drop-shadow(0px 0px 2.04348px #ffffff1e)
    drop-shadow(0px 0px 1.02174px #ffffff1e);
}

